import React from 'react'
import Button from "./Button";

class Buttons extends React.Component {
    render() {
        let buttons = this.props.action.map( action => <Button name={action.title} onClick={action.callback} /> );
        return (
            <div>
                {buttons}
            </div>
        )
    }
}

export default Buttons;
